const Home = ({ setAdmin }) => {
  useEffect(() => {}, []);
  return (
    <div className="container" style={{ maxWidth: '1500px' }}>
      <h1 className="admin-page">Products</h1>
      <div className="row">
        <Routes>
          <Route exact path="/" element={<Products />} />
          {/* <Route path="/ff" component={<div>2</div>} /> */}
        </Routes>
      </div>
    </div>
  );
};

export default Home;
